import React from 'react';
import Navbar from '../navbar/navbar';
import {Grid} from '@material-ui/core' ;


const App = () => {
  return (
    <Grid container direction = "column">
      <Grid item>This is where the header will be</Grid>
      <Grid item container>
        <Grid xs={2}/>
        <Grid xs={8}>
          Our content will live in here!
        </Grid>

      </Grid>
    </Grid>
  );
}

export default App;
